import Link from "next/link";

const Navbar = () => (
  <div>
    <style jsx>{`
      ul {
        background: #333;
        color: #fff;
        list-style: none;
        display: flex;
      }

      ul li {
        font-size: 18px;
        margin-right: 20px;
      }

      ul li a {
        color: white;
        text-decoration: none;
      }
    `}</style>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        
      </li>
    </ul>
  </div>
);

export default Navbar;
